import React from "react";
import TeamMember from "./TeamMember";

function TeamProfile() {
  const data = [
    {
      name: "John Morgan",
      img: "../images/p1.jpg",
      review: "Lorem ipsum dolor sit amet, constructur adipiscing elit",
    },
    {
      name: "Ellie Anderson",
      img: "../images/p2.jpg",
      review: "Lorem ipsum dolor sit amet, constructur adipiscing elit",
    },
    {
      name: "Nia Adebayo",
      img: "../images/p3.jpg",
      review: "Lorem ipsum dolor sit amet, constructur adipiscing elit",
    },
  ];
  return (
    <>
      <div className="">
        <div className="">
          {data.map((d) => (
            <div>
              <div>
                <img src={d.img} alt="image" />
              </div>

              <div>
                <p>{d.name}</p>
                <p>{d.review}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </>
  );
}

export default TeamProfile;
